import React from "react";
import classes from "./MateTimeBox.module.css";


const MateTimeBox =()=>{


return (

<div className={classes.mateTimeBox}>


  <div className={classes.time}> 12:37  </div>


  <div className={classes.numMsg}> 10+ </div>
</div>
);

}

export default MateTimeBox;
